import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Navbar from "./components/Navbar";
import Dashboard from "./components/Dashboard";
import LoanRequest from "./components/LoanRequest";
import Payments from "./components/Payments";
import Register from "./components/Register";
import UserManagement from "./components/UserManagement";
import OverdueLoans from "./components/OverdueLoans";
import DefaultedLoans from "./components/DefaultedLoans";
import LateLoans from "./components/LateLoans";
import Users from "./components/Users";
import LoanSearch from "./components/LoanSearch";
import LoanStatus from "./components/LoanStatus";
import Loans from "./components/Loans";

const App = () => {
  return (
    <Router>
      <Navbar />
      <div className="container mt-4">
        <>
          <Route path="/" exact component={Dashboard} />
          <Route path="/loan-request" component={LoanRequest} />
          <Route path="/payments" component={Payments} />
          <Route path="/register" component={Register} />
          <Route path="/user-management" component={UserManagement} />
          <Route path="/overdue-loans" component={OverdueLoans} />
          <Route path="/defaulted-loans" component={DefaultedLoans} />
          <Route path="/late-loans" component={LateLoans} />
          <Route path="/users" component={Users} />
          <Route path="/loan-search" component={LoanSearch} />
          <Route path="/loan-status" component={LoanStatus} />
          <Route path="/loans" component={Loans} />
        </>
      </div>
    </Router>
  );
};

export default App;

